#include <cmath>
#include <vector>

using namespace std;

class Solution {
public:
    vector<int> getAverages(vector<int>& nums, int k) {
        int n = nums.size();
        vector<int> ans(n, -1);
        long long s = 0;
        for (int i = 0; i < n; i++) {
            // 1.入窗口
            s += nums[i];
            if (i < k * 2) continue;
            // 2.更新值
            ans[i - k] = s / (k * 2 + 1);
            // 3.出窗口
            s -= nums[i - k * 2];
        }
        return ans;
    }
};

